import { Component, OnInit} from '@angular/core';
import { user}
import { Notify } from 'notiflix';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent implements OnInit {

  constructor(public apiConsume: RestApiService) {

  }

  getData(id:string): void {
    try
    {
      const id2 = parseInt(id);

      if (id2 != 0)
      {
        this.apiConsume.getItems(id2);
        Notify.success('Accion realizada correctamente.');
      }
      else
      {
        Notify.warning('Existen campos vacios.');
      }

    }
    catch
    {
      Notify.failure('Error en obtener informacion del servidor.');
    }
  }

  ngOnInit() {

  }

  title = 'Express Server Test Frontend';
}
